    "2016-07-27T22:45:53.072914",nt"name": "narrative-report-fish-springs-national-wildlife-refuge-dugway-ut-for-the-period-may-june-1-6fca9",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Fish Springs
    National Wildlife Refuge outlines Refuge accomplishments from May through August
    of 1962. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    raptors, reptiles, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, vegetation
    control, and fires. Resource management is outlined; topics include peat mining,
    and frog farming. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, violations, and safety. Items of interest,
    N-R forms, and photographs are attached.",nt"license_title": "License Not
